Nature Documentary hosted by Julie McCarthy, published by ORF in 2013 - English narration


Information
------------------------------

The muscular young cheetah marks carefully his new terrain which is full of another animal's strange smell. A couple of young falcons is excited and nervous: its first attempt at flight - and a balcony amidst the town is an unusual take off point. Also Nina is excited: she is the young keeper of the bats - and this is exactly the moment to set the young animals free to find a living in the woods around SchÃƒÂ¶nbrunn castle. 
What these animals share is their proximity to humans in a zoo - the world's oldest, Vienna's SchÃƒÂ¶nbrunn zoo: A centre for animal care, conservation and international breeding programs. This is the story about SchÃƒÂ¶nbrunn's zookeepers who devote their lives to the animals by witnessing birth, aging process, death and, occasionally, the end of an entire species. The unusual locations and spectacular camera perspectives in this film convey the intimacy of the relationship between keepers and animals. An intimacy which may lead to physical and behavioural similarities even between animals and humans.

